            <tr>
                <th>Id</th>
                <th>Nomcp</th>
                <th>Descriptioncp</th>
                <th>Personnage</th>
                <th>Imagecp</th>
                <th>Datecreation</th>
               {# <th>Nomma</th>#}

<th>Nom Material</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for cosplay in cosplays %}
            <tr>
                <td>{{ cosplay.id }}</td>
                <td>{{ cosplay.nomcp }}</td>
                <td>{{ cosplay.descriptioncp }}</td>
                <td>{{ cosplay.personnage }}</td>
                <td>{{ cosplay.imagecp }}</td>
                <td>{{ cosplay.datecreation ? cosplay.datecreation|date('Y-m-d H:i:s') : '' }}</td>
                {# <td>{{ cosplay.nomma }}</td>#}
                <td>{{ cosplay.idmateriaux }}</td>
                <td>
                    <a href=\"{{ path('app_cosplay_show', {'id': cosplay.id}) }}\">show</a>
                    <a href=\"{{ path('app_cosplay_edit', {'id': cosplay.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"8\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_cosplay_new') }}\">Create new</a>
{% endblock %}
